import base64
import io
import cv2
import numpy as np
from PIL import Image
import face_recognition
from qdrant_client import QdrantClient
from qdrant_client.models import VectorParams, Distance, PointStruct
from typing import Optional

# ----------------- CONFIGURATION -----------------
QDRANT_HOST = "localhost"
QDRANT_PORT = 6333
COLLECTION_NAME = "faces"
VECTOR_SIZE = 128  # 128-D face_recognition embeddings

# ----------------- VALIDATION HELPERS -----------------

def is_blurry(image, threshold: float = 50.0) -> bool:
    gray = cv2.cvtColor(image, cv2.COLOR_BGR2GRAY)
    return cv2.Laplacian(gray, cv2.CV_64F).var() < threshold

def is_low_resolution(image, min_w=160, min_h=160) -> bool:
    h, w = image.shape[:2]
    return w < min_w or h < min_h

def has_single_face(rgb_img) -> bool:
    face_locations = face_recognition.face_locations(rgb_img)
    return len(face_locations) == 1

def validate_image(image_bytes: bytes) -> (bool, str):
    try:
        img = Image.open(io.BytesIO(image_bytes))
        img.verify()
    except Exception:
        return False, "Error: Corrupted or unreadable image."

    np_arr = np.frombuffer(image_bytes, np.uint8)
    bgr = cv2.imdecode(np_arr, cv2.IMREAD_COLOR)
    if bgr is None:
        return False, "Error: Unable to decode image."

    if is_blurry(bgr):
        return False, "Invalid image: Too blurry."

    if is_low_resolution(bgr):
        return False, "Invalid image: Too small (min 160Ã—160)."

    rgb = cv2.cvtColor(bgr, cv2.COLOR_BGR2RGB)
    if not has_single_face(rgb):
        return False, "Invalid image: Must contain exactly one face."

    return True, "Valid image: All checks passed."

# ----------------- FACE EMBEDDING -----------------

def extract_face_embedding(image_bytes: bytes) -> Optional[list]:
    np_arr = np.frombuffer(image_bytes, np.uint8)
    image = cv2.imdecode(np_arr, cv2.IMREAD_COLOR)
    if image is None:
        return None
    rgb_image = cv2.cvtColor(image, cv2.COLOR_BGR2RGB)
    encodings = face_recognition.face_encodings(rgb_image)
    return encodings[0].tolist() if encodings else None

# ----------------- QDRANT SETUP -----------------

qdrant_client = QdrantClient(host=QDRANT_HOST, port=QDRANT_PORT)

if COLLECTION_NAME not in [c.name for c in qdrant_client.get_collections().collections]:
    print("Creating Qdrant collection...")
    qdrant_client.recreate_collection(
        collection_name=COLLECTION_NAME,
        vectors_config=VectorParams(size=VECTOR_SIZE, distance=Distance.COSINE),
    )

def store_in_qdrant(vector_id: int, embedding: list, filename: str):
    point = PointStruct(
        id=vector_id,
        vector=embedding,
        payload={"filename": filename}
    )
    qdrant_client.upsert(collection_name=COLLECTION_NAME, points=[point])

# ----------------- PIPELINE -----------------

def run_pipeline(b64_string: str, user_id="1") -> str:
    print("Decoding base64 image...")
    try:
        image_bytes = base64.b64decode(b64_string)
    except Exception:
        return "Failed: Invalid base64 format."

    print("Validating image...")
    is_valid, message = validate_image(image_bytes)
    if not is_valid:
        return f"Validation failed: {message}"

    print("Extracting face embedding...")
    embedding = extract_face_embedding(image_bytes)

    print("Storing vector in Qdrant...")
    try:
        store_in_qdrant(int(user_id), embedding, filename=f"user_{user_id}.jpg")
    except Exception as e:
        return f"Failed: {e}"

    return "Success! Face embedding stored in local Qdrant."

# ----------------- USAGE -----------------

# Replace SAMPLE_B64 with an actual base64-encoded image string
SAMPLE_B64 = ""  

if __name__ == "__main__":
    result = run_pipeline(SAMPLE_B64, user_id="1")
    print(result)

